import { NavLink } from 'react-router-dom';
import userPhoto from '../../assets/images/avaDefault.jpeg';
import Paginator from '../common/Paginator/Pagination';
import User from './User';
import s from './Users.module.css';

let Users = ({totalUserCount, pageSize, currentPage, onPageChanged, users, followingInProgress, unfollowThunkCreator, followThunkCreator}) => {
    let pagesCount = Math.ceil(props.totalUserCount / props.pageSize)
    let pages = [];
    for (let i = 1; i <= pagesCount; i++) {
        pages.push(i);
    }
    return <div>
        <Paginator totalUserCount={totalUserCount} pageSize={pageSize} currentPage={currentPage} onPageChanged={onPageChanged}/>
        {
            users.map(u => <User followingInProgress={followingInProgress} unfollowThunkCreator={unfollowThunkCreator} followThunkCreator={followThunkCreator} user = {u} key={u.id}/>)
        }
    </div>
};

export default Users;
